import React, { Component } from 'react'
import {ProductConsumer} from '../context'

export default class Details extends Component {
    render() {
        return (
            <ProductConsumer>
                {value => {
                    const {id,img,company,info,price,title,inCart} = value.detailProduct;
                }}
            </ProductConsumer>
        )
    }
}
